    false,nt"url": null,nt"notes": "The Los Angeles River has been designated
    as an impaired waterbody due to the large volume of trash it receives from the watershed.
    To address this problem a Total Maximum Daily Load (TMDL), which establishes baseline
    trash loads to the river from the watershed, has been incorporated into the area
    stormwater permit. The permit requires each permittee to implement trash reduction
    measures for discharges through the storm drain system with an emphasis on the installation
    of full capture devices. The stormwater permit incorporates progressive reductions
    in trash discharges to the Los Angeles River, reaching a zero level in 2016.",nt"license_title":
